Revenge Porn
Anna Richardson goes to extraordinary lengths to investigate what happens when someone maliciously shares intimate photos of another person without their consent. Anna meets the victims of such actions, talks to experts and confronts the perpetrators of these crimes, the effects of which can have devastating and life-changing consequences. As she digs deeper, she discovers a community of men who take pleasure from threatening and shaming women online and decides to place herself at the epicentre of the revenge porn phenomenon.

